import React from 'react';

const HeaderStyles = {
    container: {
        backgroundColor: 'white',
        padding: '40px',
    },
    heading: {
        color: 'grey',
    }
}

const Header = (props) => {
    return (
        <div style={HeaderStyles.container}>
            <h1 style={HeaderStyles.heading}>Tricky Clicks</h1>
        </div>
    )
}

export default Header;
